Let me think through this step by step...

The key psychological mechanisms involved in responder behavior in this economic game are fairness and self-interest.  Responders may accept offers that they perceive as fair, even if they are slightly below their own contribution in terms of tokens (and thus money). Conversely, they are likely to reject offers that they perceive as unfair, even if those offers are financially beneficial.  The degree to which an individual prioritizes fairness over self-interest can vary, depending on individual differences in social preferences.  This could be considered a trade off between these two values.

How these mechanisms interact: The perceived fairness of an offer interacts with the financial gain from the offer.  A highly unfair offer, even if it yields a high monetary gain, might be rejected. A fairly balanced offer that still provides a positive gain might be accepted. Thus, the interaction involves both a computation of fairness and a weighting of fairness against monetary benefit.

What mathematical form could capture these interactions: A simple multiplicative model would capture this interaction. Fairness could be captured by the ratio of the proposed split compared to the contribution ratio of the tokens. We could introduce a parameter representing how much weight is given to fairness relative to the monetary gain.  We will also use the combined earnings, as a fair split is relative to this value.

What parameters would be needed to calibrate the model: Two learnable parameters will suffice: one representing the weight given to fairness, and one representing the minimum acceptable percentage of combined earnings before fairness is even considered.

How the model variables map to observable behavior:  The model predicts the utility of accepting an offer. The higher the utility, the more likely the offer is to be accepted. The model uses the token ratio and monetary gain to calculate a fairness metric and combines this with the financial gain to produce the utility of acceptance. The parameters allow for individual differences in sensitivity to fairness and in the minimum acceptable amount.

